import React from "react";

function Footer() {
  return (
    <footer className="flex flex-col items-center justify-center gap-5">
      <img
        className="cursor-pointer"
        src="/assets/ESPORTS-TEAM-01.png"
        width={70}
        alt="logo"
      />
    </footer>
  );
}

export default Footer;
